import styled from '@emotion/styled'

export const Wrapper = styled.div`
  text-align: center;
`
export const Header = styled.h2`
  color: #4b3b40;
`
export const InputName = styled.p`
  color: #82735c;
  margin: 0;
`
export const SubmitButton = styled.button`
  background-color: #9db17c;
  color: white;
  margin-top: 20px;
  cursor: pointer;
`
